import * as React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { Stack } from '@mui/material';
import { padding } from '@mui/system';
import { useNavigate } from 'react-router-dom';

const Join: React.FC = () => {
    const navigate = useNavigate();

    const goIdcheck = () => {
        navigate('/Idcheck')
    };
    return (
        <div className='join'>
            <Box sx={{ display: 'flex',position:'relative', width:550, height: 450, margin:'auto', textAlign:'center', border: 1, borderRadius: 5, backgroundColor:'#ffffff', flexDirection: 'column',mt:5, padding: 5 }} >
                <Typography sx={{fontSize: 32, pb:3 }}>회원 가입</Typography>
                <Stack  direction="row" spacing={2} alignItems="center" >
                    <TextField id="join-id" label="아이디" variant="outlined" size="small" margin="normal"/>
                    <Button variant="outlined"  size="small" sx={{ width: 100, height:20, color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343', borderRadius: 10 }} onClick={() => { goIdcheck() }}>
                        중복 확인
                    </Button>
                </Stack>
                <TextField id="join-pw" label="비밀번호" variant="outlined" size="small"  margin="normal"  sx={{ width: 300 }}/>
                <TextField id="join-pw" label="비밀번호 확인" variant="outlined" size="small"  margin="normal" sx={{ width: 300 }}  />
                <TextField id="join-name" label="이름" variant="outlined" size="small" margin="normal" sx={{ width: 200 }}/>
                <br/>
                <Stack  direction="row" spacing={3} >
                            <TextField id="login-email" label="이메일아이디" variant="outlined" size="small"/>
                            <Box sx={{ display: 'flex', alignItems: 'center'}}>
                                <Typography>@</Typography>
                            </Box>
                            <TextField id="login-email" label="이메일" variant="outlined" size="small" sx={{ width: 300 }}/>
                </Stack>
                <br/>
                <Button variant="outlined"  size="small" sx={{ width: 100, mt:3, mx:'auto', color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}} >
                    회원 가입
                </Button>
            </Box>
        </div>
    );
}
export default Join;
